sys_variable_value.value:
(function execute(inputs, outputs) {
  var addmemberId = inputs.addMember;
  var removememberId = inputs.removeMember;
  if(addmemberId != ""){
    outputs.addmembers = JSON.stringify(addmemberId);
  }
  else{
    outputs.addmembers = '';
  }
  if(removememberId != ""){
    outputs.removemembers = JSON.stringify(removememberId);
  }
  else{
    outputs.removemembers = "";
  }
  if(inputs.color && inputs.letter){
    outputs.avatar = inputs.avatar;
  }
  else{
    outputs.avatar = "";
  }
})(inputs, outputs);

